import styled from 'styled-components';

export const Form = styled.form`
  display: flex;
  align-items: center;
  width: 300px;
  height: 50px;
  border-radius: 5px;
  background-color: #4654e1;
`;

export const Input = styled.input`
  all: unset;
  height: 100%;
  width: 100%;
  padding: 0px 10px;
  background-color: green;
  font: 16px system-ui;
`;

export const Button = styled.button`
  display: flex;
  align-items: center;
  all: unset;
  cursor: pointer;
  width: 44px;
  height: 44px;
  background-color: violet;
`;

export const Svg = styled.svg`
  color: #fff;
  fill: currentColor;
  width: 24px;
  height: 24px;
  background-color: red;
`;
